export const CurrentLevel = Object.freeze({
  EASY: {
    name: 'EASY',
    rows: 10,
    columns: 8,
    num_mine: 1, //10 ojooooooooooo
  },

  INTERMEDIATE: {
    name: 'INTERMEDIATE',
    rows: 500,//18,
    columns: 50,// 14,
    num_mine: 40,
  },

  EXPERT: {
    name: 'EXPERT',
    rows: 23,
    columns: 23,
    num_mine: 99,
  }
})

export const InitialState = {
  board: [],
  level: CurrentLevel.INTERMEDIATE,
  gameOver: false,
  hiddenMines: CurrentLevel.INTERMEDIATE.num_mine,
  winner: false,
  clickNumber: 0,
};

export const InjectMineEnum = Object.freeze({
  DO_NOT_INJECT: 0,
  INJECT: 1
});
